        let yH = variable.highArr.at(-i - 1)
        currWeightHigh += yH * w

        // quadratic based on lows
        let yL = variable.lowArr.at(-i - 1)
        currWeightLow += yL * w
    }
    outValQuad = currWeight / cumWeight
    outValQuadHigh = currWeightHigh / cumWeight
    outValQuadLow = currWeightLow / cumWeight

    // calculate ATR of the quads
    let trueRange = Math.max(Math.max(outValQuadHigh - outValQuadLow, Math.abs(outValQuadHigh - variable.value)), Math.abs(outValQuadLow - variable.value))

    atrQuad = rma(trueRange, variable.atrPrev, atrLen)
}

