function rsiTV(dataArray, length, upRmaPrev, dnRmaPrev) {
    // a replication of Tradingview's RSI function
    // currently needs 2 defined variables to access previous data
    let upVal = Math.max(dataArray.at(-1) - dataArray.at(-2), 0) // upward change
    let downVal = Math.max(dataArray.at(-2) - dataArray.at(-1), 0) // downward change

    let upRma = rma(upVal, upRmaPrev, length)
    let dnRma = rma(downVal, dnRmaPrev, length)

    let rs = upRma / dnRma
    let res = 100 - 100 / (1 + rs)

    //returned values
    this.value = res
    this.upRma = upRma
    this.dnRma = dnRma
}

// use in conjunction with rsiTV
function rma(price, prevRMA, length) {
    // Used in conjunction with Tradingview's RSI function
    let k = 1 / length
    let rmaCalc = price * k + prevRMA * (1 - k)
    return rmaCalc
}

function rescale(src, oldMin, oldMax, newMin, newMax) {
    const smNum = 10e-10
    let result = newMin + (newMax - newMin) * (src - oldMin) / Math.max(oldMax - oldMin, smNum)
    return result
}


