function get_lorentzian_distance(i, featureSeries, featureArrays) {
    let f1 = Math.log(1 + Math.abs(featureSeries[0] - featureArrays[0][i]))
    let f2 = Math.log(1 + Math.abs(featureSeries[1] - featureArrays[1][i]))
    let f3 = Math.log(1 + Math.abs(featureSeries[2] - featureArrays[2][i]))
    let f4 = Math.log(1 + Math.abs(featureSeries[3] - featureArrays[3][i]))
    let f5 = Math.log(1 + Math.abs(featureSeries[4] - featureArrays[4][i]))

    return f1 + f2 + f3 + f4 + f5
}
